const Navbar = () => {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);
    
    return (
        <nav className="navbar">
            <h1 >Test</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/">Away</a>
            </div>
        </nav>
    )
}

export default Navbar;
